(1, 'রোস্তমনগর বালিকা উচ্চ বিদ্যালয়', 'শিক্ষাই জাতির মেরুদন্ড', '১৯৯৩', '১২০৯৯১', '', 'rustom-nogor-balika.png', '', '০১৭১৪২২৯০৫১', 'rnghs@gmail.com', 'মন্মথপুর, পার্বতীপুর, দিনাজপুর', 'www.rnghs.edu.bd', 'রোস্তমনগর বালিকা উচ্চ বিদ্যালয়', 'সকাল ৯:০০ থেকে বিকাল ৫:০০', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3596.5464994416097!2d88.91260521720339!3d25.653172722175377!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x39fcad33c34262b5%3A0x63b61b51f9d8f0ec!2sParbatipur+Railway+Junction!5e0!3m2!1sen!2sbd!4v1477110413728\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0\" allowfullscreen></iframe>', 'প্রতিষ্ঠানটি দিনাজপুর জেলার পার্বতীপুর থানার মন্মথপুর এ অবস্থিত ।  ১৯৮৯ ইং সালে প্রতিষ্ঠিত হয়ে অদ্যাবদি ছড়িয়ে যাচ্ছে বিদ্যার আলো । বর্তমান যুগ আধুনিক সভ্যতার যুগ , তথা কম্পিউটার যুগ । আধুনিক সভ্যতার সাথে তাল মিলিয়ে কম্পিউটারে ের ব্যবহার চলছে এ মাদ্‌রাসাতেও । অতীত ঐতিহ্যকে ধারন করে , নুতুন সভ্যতার অংশ ছড়িয়ে ডিজিটাল বাংলাদেশ ‘ তথা স্বপ্নের বাংলাদেশ গড়তে সহায়তায় সফলকাম হবে বিদ্যালয়টি', 'প্রদিপ কুমার সাহা ', '০১৭১৪২২৯০৫১', 'rnghs@gmail.com', 'stock-vector-man-icon-man-icon-vector-man-icon-art-man-icon-eps-man-icon-img-man-icon-logo-man-icon-sign-380655355.jpg', 'stock-vector-man-icon-man-icon-vector-man-icon-art', 'প্রতিষ্ঠানটি দিনাজপুর জেলার পার্বতীপুর থানার মন্মথপুর এ অবস্থিত ।  ১৯৮৯ ইং সালে প্রতিষ্ঠিত হয়ে অদ্যাবদি ছড়িয়ে যাচ্ছে বিদ্যার আলো । বর্তমান যুগ আধুনিক সভ্যতার যুগ , তথা কম্পিউটার যুগ । আধুনিক সভ্যতার সাথে তাল মিলিয়ে কম্পিউটারে ের ব্যবহার চলছে এ মাদ্‌রাসাতেও । অতীত ঐতিহ্যকে ধারন করে , নুতুন সভ্যতার অংশ ছড়িয়ে ডিজিটাল বাংলাদেশ ‘ তথা স্বপ্নের বাংলাদেশ গড়তে সহায়তায় সফলকাম হবে বিদ্যালয়টি । আল্লাহ আমাদের তৌফিক দিন আমীন।', 'blankavatar.jpg', 'lightgreentheme', NULL, NULL, NULL);
